import React, { Component } from 'react';

const makeActive = (selected) => {
	console.log(selected);

}

class SubNav extends Component {
	constructor(props) {
		super(props);
		this.state = { selected: 1 }
	}

	render() {
		return (
			<div className="subnav__wrapper">
				<div className="subnav__item" onClick={makeActive.bind(null, selected)}>
					<img/>
					<h2>Flywheel Managed Service</h2>
					<p>Have our experts do it for you</p>
				</div>
				<div className="subnav__item--active" onClick={makeActive.bind(null, selected)}>
					<img/>
					<h2>Flywheel</h2>
					<p>Manage products & campaigns on your own</p>
				</div>
				<div className="subnav__item" onClick={makeActive.bind(null, selected)}>
					<img/>
					<h2>For Agencies</h2>
					<p>Create value for your own customers</p>
				</div>
			</div>
		)
	}
}

export default SubNav
